    false,nt"url": null,nt"notes": "Spatial management files combine all related
    and relevant spatial management files into an integrated fisheries management file.
    Overlaps of the redundant spatial restrictions were removed by defining the least
    to the most restrictive management measures and then doing updates on the less restrictive
    measures. FROM least restrictive to MOST Restrctive>>>>Habitat Conservation Areas
    || Habitat Protection Areas, Habitat Coral Areas || Special Habitat Areas || Steller
    Sea Lion Protection Measures, Walrus Protection Measures, Walrus No Entry Areas,
    and finally the most restrictive, the Steller No Transit Area. Arc operation employed:
    UPDATE.Data compiled from regulatory packages including ' 679.22 Closures. Tables
    4, 5, 6, 22, 23, 24, 25, 26, 27'226.202 Critical habitat for Steller sea lions.50
    CFR 223.202, No Transit AreasData was made available in several formats including:
    ArcGIS Featureclasses, shapefiles, AutoCad files, and within an integrated CarryMap
